import React from "react";

const Filters = () => {
  return (
    <div class="container-fluid text-bg-primary text-center">
      <div class="row">
        <div class="col">Module</div>
        <div class="col">Section</div>
        <div class="col">Group</div>
        <div class="col">Matricule</div>
        <div class="col">submit</div>
      </div>
    </div>
  );
};

export default Filters;
